        this.localSource = src; //    if (this.localVideo && src) this.localVideo.srcObject = src; 

        if (!isCaller) newState.callModal = '';
        this.setState(newState);
      }).on('peerStream', src => {
        this.multiStreamRecorder = RecordRTC([this.localSource, src], {
          // audio, video, canvas, gif
          type: 'video',
          mimeType: 'video/mp4',
          recorderType: RecordRTC.MultiStreamRecorder,
          // disable logs
          disableLogs: true,
          // get intervals based blobs
          // value in milliseconds
          timeSlice: 180000,
          checkForInactiveTracks: false,
          // requires timeSlice above
          // returns blob via callback function
          ondataavailable: function (e) {
            var normalArr = [];
            /*
                Here we push the stream data to an array for future use.
            */

            self.recordedChunks.push(e);
            normalArr.push(e);
            let size = self.bytesToSize(e.size);
            console.log('size ', size);
            console.log('recordedChunks -- ', self.recordedChunks);

            if (self.recordedChunks.length == 1) {
              //     console.log(blob.size);
              console.log('startMultiUpload -- ');
              self.startMultiUpload(e, self.filename);
            } else {
              /*
                  self.incr is basically a part number.
                  Part number of part being uploaded. This is a positive integer between 1 and 10,000.
              */
              console.log('continueMultiUpload -- ');
              self.incr = self.incr + 1;
              self.continueMultiUpload(e, self.incr, self.uploadId, self.filename, self.bucketName);
            }
          },
          // auto stop recording if camera stops
          checkForInactiveTracks: false,
          // requires timeSlice above
          onTimeStamp: function (timestamp) {},
          // both for audio and video tracks
          bitsPerSecond: 128000,
          // if you are recording multiple streams into single file
          // this helps you see what is being recorded
          previewStream: function (stream) {
            console.log(stream);
          },
          // used by MultiStreamRecorder - to access HTMLCanvasElement
          elementClass: 'multi-streams-mixer'
        });
        var arrayOfWebPImages = [];
        arrayOfWebPImages.push({
          duration: 0,
          image: 'data:image/png;base64,'
        });
        arrayOfWebPImages.push({
          duration: 1,
          image: 'data:image/jpeg;base64,'
        });
        this.multiStreamRecorder.setAdvertisementArray(arrayOfWebPImages); //         if (this.peerVideo && src) this.peerVideo.srcObject = src;

        this.setState({
          peerSrc: src
        });
      }).start(isCaller, config);
    } else {
      if (keyObject && keyObject.state && keyObject.state.videoKeyClient) {
        let videoKeyClient = keyObject.state.videoKeyClient;
        console.log(' this.pcCheck tested');
        this.pcCheck = true;
        this.pc = new PeerConnection(videoKeyClient).on('localStream', src => {
          const newState = {
            callWindow: 'active',
            localSrc: src
          };
          if (!isCaller) newState.callModal = ''; //         if (this.localVideo && src) this.localVideo.srcObject = src;      

          this.setState(newState);
        }).on('peerStream', src => {
          //         if (this.peerVideo && src) this.peerVideo.srcObject = src;
          this.setState({
            peerSrc: src
          });
        }).start(isCaller, config);
      }
    }
  }

  bytesToSize(bytes) {
    var k = 1000;
    var sizes = ['Bytes', 'KB', 'MB', 'GB', 'TB'];
    if (bytes === 0) return '0 Bytes';
    var i = parseInt(Math.floor(Math.log(bytes) / Math.log(k)), 10);
    return (bytes / Math.pow(k, i)).toPrecision(3) + ' ' + sizes[i];
  }

